define('text!views/list.html',[],function () { return '<section>\n\t\t<h2>List</h2>\n\t\t<table>\n\t\t\t<thead>\n\t\t\t\t<th>Date</th>\n\t\t\t\t<th>Description</th>\n\t\t\t\t<th>Amount</th>\n\t\t\t\t<th>Category</th>\n\t\t\t</thead>\n\t\t\t<tbody data-bind="foreach: verifications">\n\t\t\t\t<tr>\n\t\t\t\t\t<td data-bind="text: date.value"></td>\n\t\t\t\t\t<td data-bind="text: description.value"></td>\n\t\t\t\t\t<td data-bind="text: amount.value"></td>\n\t\t\t\t\t<td class="category"><input data-bind="value: category ? category.value : \'Uncategorized\'"/>\n\t\t\t\t\t\t<!--<input class="category" data-bind="text: category.value ? category.value : \'Uncategorized\', css: {uncategorized: !category.value, single: category.value && !patternId, pattern: category.value && patternId}"/>-->\n\t\t\t\t\t</td>\n\t\t\t\t</tr>\n\t\t\t</tbody>\n\t\t</table>\n</section>\n\n<p/>\n<footer>&copy; Erik Larsson 2014</footer>';});

