define('text!views/shell.html',[],function () { return '<div>\n    <div class="navbar navbar-inverse navbar-fixed-top">\n        <div class="navbar-inner">\n            <div class="container">\n                <a class="brand" data-bind="attr: { href: router.navigationModel()[0].hash }">\n                    <span>RDF Workbench</span>\n                </a>\n                <ul class="nav" data-bind="foreach: router.navigationModel">\n                    <!-- ko if: hash != \'#\' -->\n                    <li data-bind="css: { active: isActive }">\n                        <a data-bind="attr: { href: hash }, html: title"></a>\n                    </li>\n                    <!-- /ko -->\n                </ul>\n                <div class="loader pull-right" data-bind="css: { active: router.isNavigating }">\n                    <i class="icon-spinner icon-2x icon-spin"></i>\n                </div>\n    <!--             <form class="navbar-search pull-right" data-bind="submit:search">\n                    <input type="text" class="search-query" placeholder="Search">\n                </form>\n     -->\n            </div>\n        </div>\n    </div>\n    \n    <div class="container page-host" data-bind="router: { transition:\'entrance\', cacheViews:true }"></div>\n</div>';});

